import React, { useState, useEffect, useRef } from 'react';
import './app.css';

const MoodMate = () => {
  const [activeTab, setActiveTab] = useState('chat');
  const [user] = useState({
    username: 'Arnav._.singh__'
  });

  return (
    <div className="app-container">
      {/* Header */}
      <header className="app-header">
        <div className="header-left">
          <h1>MoodMate</h1>
          <div className="nav-tabs">
            <button 
              className={activeTab === 'chat' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('chat')}
            >
              💬 Chat
            </button>
            <button 
              className={activeTab === 'ai-coach' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('ai-coach')}
            >
              🤖 AI Coach
            </button>
            <button 
              className={activeTab === 'therapy' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('therapy')}
            >
              👨‍⚕️ Therapy
            </button>
            <button 
              className={activeTab === 'community' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('community')}
            >
              🌍 Community
            </button>
            <button 
              className={activeTab === 'report' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('report')}
            >
              📊 Report
            </button>
            <button 
              className={activeTab === 'profile' ? 'nav-tab active' : 'nav-tab'}
              onClick={() => setActiveTab('profile')}
            >
              👤 Profile
            </button>
          </div>
        </div>
        <div className="header-right">
          <div className="user-info">
            <span className="username">{user.username}</span>
            <button className="logout-btn">Logout</button>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="app-main">
        {activeTab === 'chat' && <Chat user={user} />}
        {activeTab === 'ai-coach' && <AICoach />}
        {activeTab === 'therapy' && <Therapy />}
        {activeTab === 'community' && <Community />}
        {activeTab === 'report' && <Report />}
        {activeTab === 'profile' && <Profile />}
      </main>
    </div>
  );
};

// Chat Component with Scrollbar and Deletion
const Chat = ({ user }) => {
  const [messages, setMessages] = useState([
    { id: 1, text: "Hello Arnav._.singh__! I'm MoodMate. How can I help you today?", sender: 'bot' }
  ]);
  const [inputText, setInputText] = useState('');
  const [isTyping, setIsTyping] = useState(false);
  const chatEndRef = useRef(null);
  const chatContainerRef = useRef(null);

  // Auto-scroll to bottom when messages change
  useEffect(() => {
    if (chatEndRef.current) {
      chatEndRef.current.scrollIntoView({ behavior: "smooth" });
    }
  }, [messages, isTyping]);

  // Check if scrollbar is needed
  useEffect(() => {
    const checkScrollbar = () => {
      if (chatContainerRef.current) {
        const hasScrollbar = chatContainerRef.current.scrollHeight > chatContainerRef.current.clientHeight;
        if (hasScrollbar) {
          chatContainerRef.current.classList.add('has-scrollbar');
        } else {
          chatContainerRef.current.classList.remove('has-scrollbar');
        }
      }
    };
    
    checkScrollbar();
    window.addEventListener('resize', checkScrollbar);
    return () => window.removeEventListener('resize', checkScrollbar);
  }, [messages]);

  const handleSendMessage = () => {
    if (inputText.trim() === '') return;
    
    // Add user message
    const newUserMessage = {
      id: Date.now(),
      text: inputText,
      sender: 'user'
    };
    
    setMessages([...messages, newUserMessage]);
    setInputText('');
    setIsTyping(true);
    
    // Simulate bot response after a delay
    setTimeout(() => {
      const botResponses = [
        "I understand how you're feeling. Would you like to try a quick breathing exercise?",
        "That's an interesting perspective. Tell me more about that.",
        "I'm here to support you. Remember, it's okay to feel this way sometimes.",
        "Based on what you're saying, it might help to reflect on what's triggering these feelings.",
        "Thank you for sharing. Let's work through this together."
      ];
      
      const randomResponse = botResponses[Math.floor(Math.random() * botResponses.length)];
      
      const newBotMessage = {
        id: Date.now() + 1,
        text: randomResponse,
        sender: 'bot'
      };
      
      setMessages(prev => [...prev, newBotMessage]);
      setIsTyping(false);
    }, 1500);
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleSendMessage();
    }
  };

  const deleteMessage = (id) => {
    setMessages(messages.filter(msg => msg.id !== id));
  };

  return (
    <div className="chat-container">
      <div className="chat-header">
        <div className="chat-header-avatar">M</div>
        <div className="chat-header-info">
          <h2>MoodMate Assistant</h2>
          <p>Always here to listen</p>
        </div>
      </div>

      <div className="chat-box" ref={chatContainerRef}>
        <div className="messages-container">
          {messages.map((message) => (
            <div key={message.id} className={`chat-message ${message.sender}`}>
              <div className="message-content">
                {message.text}
                {message.sender === 'user' && (
                  <button 
                    className="delete-message-btn"
                    onClick={() => deleteMessage(message.id)}
                    title="Delete message"
                  >
                    ×
                  </button>
                )}
              </div>
            </div>
          ))}
          
          {isTyping && (
            <div className="chat-message bot">
              <div className="typing-indicator">
                <span></span>
                <span></span>
                <span></span>
              </div>
            </div>
          )}
          <div ref={chatEndRef} className="scroll-anchor"></div>
        </div>
      </div>

      <div className="input-area">
        <input
          type="text"
          placeholder="Type your message..."
          value={inputText}
          onChange={(e) => setInputText(e.target.value)}
          onKeyPress={handleKeyPress}
          disabled={isTyping}
        />
        <button 
          className="send-btn"
          onClick={handleSendMessage}
          disabled={isTyping || inputText.trim() === ''}
        >
          {isTyping ? '...' : '➤'}
        </button>
      </div>
    </div>
  );
};

// Placeholder components for other tabs
const AICoach = () => (
  <div className="tab-content">
    <h2>AI Coach</h2>
    <p>Your AI Coach content here...</p>
  </div>
);

const Therapy = () => (
  <div className="tab-content">
    <h2>Therapy</h2>
    <p>Your Therapy content here...</p>
  </div>
);

const Community = () => (
  <div className="tab-content">
    <h2>Community</h2>
    <p>Your Community content here...</p>
  </div>
);

const Report = () => (
  <div className="tab-content">
    <h2>Report</h2>
    <p>Your Report content here...</p>
  </div>
);

const Profile = () => (
  <div className="tab-content">
    <h2>Profile</h2>
    <p>Your Profile content here...</p>
  </div>
);

export default MoodMate;
